import React, { Component } from "react";

import "../styles/App.css";

class Footer3 extends Component {
  render() {
    return (
      <div id="footerRow2">
        <footer class="container-fluid">
          <div class="row">
              <div class="col-md-12 col-sm-12 offset-md-0">
              <div id="listFooter2">
                <ul id="horizontal-list">
                  <li>
                    <a href="#" class="textfooter">
                      {" "}
                      muhammadridhorosa@gmail.com
                    </a>
                  </li>
                  <li class="textfooter">+62 818 0222 8261</li>
                </ul>
              </div>
            </div>
          </div>

          <div class="row">
            <div class="col-md-12 col-sm-12 offset-md-0">
              <p id="copyright"> &copy; Copyright InaTech Group 2019</p>
            </div>
          </div>
        </footer>
      </div>
    );
  }
}

export default Footer3;
